import React, { Component } from 'react';

class FooterComponent extends Component {
    render() {
        return (
            <footer className="fixed-bottom justify-content-md-center">
                    <small>
                        ADS - 2021
                    </small>
            </footer>
        );
    }
}

export default FooterComponent;
